IF OBJECT_ID('dbo.Country', 'U') IS NOT NULL 
	DROP TABLE [dbo].Country

CREATE TABLE [Country] 
(
    [Code]	VARCHAR(512),
    [Name]	VARCHAR(512),
    [ISO2Code]	VARCHAR(512),
    [ISO3Code]	VARCHAR(512),
    [OITRegion]	VARCHAR(512),
    [OITSubregion]	VARCHAR(512),
    [OITCountryZone]	VARCHAR(512),
    [WorldBankIncomeGroup]	VARCHAR(512),
    [Continent]	VARCHAR(512),
    [EuropeZone]	VARCHAR(512),
    [CountryKey]	INT
);

